(() => {
  // src/index.ts
  (function(Scratch2) {
    const DeeplExtPicture = "data:image/svg+xml;base64,";
    const DeeplExtIcon = "data:image/svg+xml;base64,";
    if (Scratch2.extensions.unsandboxed === false) {
      throw new Error("Sandboxed mode is not supported");
    }
    const ExtI10n = {
      "zh-cn": {
        "DeeplX.name": "DeeplX \u7FFB\u8BD1",
        "DeeplX.render": "\u4F7F\u7528DeeplX\u670D\u52A1\u7FFB\u8BD1[text]\uFF0C\u4ECE[original]\u5230[to]"
      },
      en: {
        "DeeplX.name": "DeeplX Translation",
        "DeeplX.render": "Use the DeeplX service to translate [text] from [original] to [to]"
      }
    };
    Scratch2.translate.setup(ExtI10n);
    function GetI10n(id) {
      return Scratch2.translate({ id, default: id, description: id });
    }
    class DeeplX {
      runtime;
      constructor(runtime) {
        this.runtime = runtime;
      }
      getInfo() {
        return {
          id: "DeeplX",
          name: GetI10n("DeeplX.name"),
          color1: "#0f2b46",
          blockIconURI: DeeplExtIcon,
          menuIconURI: DeeplExtIcon,
          blocks: [
            {
              blockType: Scratch2.BlockType.REPORTER,
              opcode: "render",
              text: GetI10n("DeeplX.render"),
              arguments: {
                text: {
                  type: Scratch2.ArgumentType.STRING,
                  defaultValue: "Hello World"
                },
                original: {
                  type: Scratch2.ArgumentType.STRING,
                  defaultValue: "en"
                },
                to: {
                  type: Scratch2.ArgumentType.STRING,
                  defaultValue: "ZH"
                }
              }
            }
          ]
        };
      }
      render(args) {
        return new Promise((resolve, reject) => {
          const request = new XMLHttpRequest();
          request.open("POST", "https://api.deeplx.org/translate");
          request.setRequestHeader("Content-type", "application/json");
          request.responseType = "json";
          request.onload = function() {
            if (request.status === 200) {
              const responseData = request.response;
              resolve(responseData.data);
            } else {
              reject(new Error("Request failed: " + request.statusText));
            }
          };
          request.onerror = function() {
            reject(new Error("Network error"));
          };
          const data = {
            text: args.text,
            source_lang: args.original,
            target_lang: args.to
          };
          request.send(JSON.stringify(data));
        });
      }
    }
    if (Scratch2.vm?.runtime) {
      Scratch2.extensions.register(new DeeplX(Scratch2.runtime));
    } else {
      window.tempExt = {
        Extension: DeeplX,
        info: {
          extensionId: "DeeplX",
          name: "DeeplX.name",
          iconURL: DeeplExtPicture,
          insetIconURL: DeeplExtIcon,
          description: "DeeplX.description",
          featured: true,
          disabled: false,
          collaboratorList: [
            {
              collaborator: "\u591Abug\u7684\u5578\u5929\u72AC @ CCW",
              collaboratorURL: "https://www.ccw.site/student/6200811f05660557606c8b15"
            }
          ]
        },
        l10n: {
          "zh-cn": {
            "DeeplX.name": "DeeplX \u7FFB\u8BD1",
            "DeeplX.description": "\u901A\u8FC7DeeplX\u670D\u52A1\u514D\u8D39\u4F7F\u7528Deepl-pro\u7FFB\u8BD1api "
          },
          en: {
            "DeeplX.name": "DeeplX Translation",
            "DeeplX.description": "Free Deepl-pro translation api via DeeplX service"
          }
        }
      };
    }
  })(Scratch);
})();
